import { Link, Navigate, useParams } from "react-router-dom";

function PokeDetail() {
    const {name} = useParams();

    return (
        <div className="pokemon-container">
            <h1>{name}</h1>

            <Link to="/">Go back</Link>
        </div>
    )
}

export default PokeDetail;
